const Footer = () => {
  return (
    <footer className="footer">
      <div className="container">
        <div className="footer__inner">
          <p className="footer__text">Разработка сайта <a className="footer__link" href="https://faxweb.ru" target="_blank" rel="noreferrer">FaxWeb</a></p>
        </div>
      </div>
    </footer>
  )
}

export default Footer
